import React from 'react';


const ImageList = (props) => {
    console.log("images"+props.image)
    const images = props.image.map((image)=>{
        return(
            <img key={image.id} src={image.urls.thumb}></img>
        )
    })
    return (
        <div>ImageList:{
            images
        }</div>
    );
};
export default ImageList;
